        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](12, "span", 8);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](13, "The purpose of the Conflict of Interest Policy is:");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](14, "p", 9);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](15, "Charitable organizations are frequently subject to intense public scrutiny, especially where they appear to have inappropriately benefited their Officers, Directors, or Trustees. The IRS also has an oversight role with respect to charitable organizations. An important part of this oversight is providing organizations with strategies that will help avoid the appearance or actuality of private benefit to individuals who are in a position of substantial authority. The recommended conflict of interest policy is a strategy we encourage organizations to adopt as a means to establish procedures that will offer protection against charges of impropriety involving officers, directors, or trustees.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](16, "p", 9);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](17, "A conflict of interest occurs where individuals\u2019 obligation to further the organization\u2019s charitable purposes is at odds with their own financial interests. For example, a conflict of interest would occur where an Officer, Director, or Trustee votes on a contract between the organization and a business that is owned by the officer, director or trustee. Conflicts of interest frequently arise when setting compensation or benefits for officers, directors, or trustees. A conflict of interest policy is intended to help ensure that when actual or potential conflicts of interest arise, the organization has a process in place under which the affected individual will advise the governing body about all the relevant facts concerning the situation. A conflict of interest policy is also intended to establish procedures under which individuals who have a conflict of interest will be excused from voting on such matters. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](18, "p", 9);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](19, "Apart from any appearance of impropriety, organizations will lose their tax-exempt status unless they operate in a manner consistent with their charitable purposes. Serving private interests more than insubstantially is inconsistent with accomplishing charitable purposes. For example, paying an individual who is in a position of substantial authority excessive compensation serves a private interest. Providing facilities, goods, or services to an individual who is in a position of substantial authority also serves a private interest unless the benefits are part of a reasonable compensation arrangement or they are available to the public on equal terms and conditions.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](20, "p", 9);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](21, "Here\u2019s a sample Conflict of Interest Policy I wrote for Transcontinental Humanitarian Corp. Do not just copy and paste this policy. Read it carefully, and draft yours based on the information given here.");
