        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](33, "It is important for Transcontinental Humanitarian Corp. directors, officers, and staff to be aware that both real and apparent conflicts of interest or dualities of interest sometimes occur in the course of conducting the affairs of the corporation and that the appearance of conflict can be troublesome even if there is in fact no conflict whatsoever. Conflicts occur because the many persons associated with the corporation should be expected to have, and do in fact generally have multiple interests and affiliations and various positions of responsibility within the community. In these situations a person will sometimes owe identical duties of loyalty to two or more corporations. The purpose of the conflict of interest policy is to protect the corporation\u2019s tax-exempt interest when it is contemplating entering into a transaction or arrangement that might benefit the private interest of an officer or director of the corporation or might result in a possible excess benefit transaction. The policy is intended to supplement but not replace any applicable state and federal laws governing conflict of interest applicable to nonprofit and charitable organizations.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
