        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](35, "Conflicts are undesirable because they potentially or eventually place the interests of others ahead of the corporation\u2019s obligations to its charitable purposes and to the public interest. Conflicts are also undesirable because they often reflect adversely upon the person involved and upon the institutions with which they are affiliated, regardless of the actual facts or motivations of the parties. However, the long-range best interests of the corporation do not require the termination of all association with persons who may have real or apparent conflicts that are harmless to all individuals or entities involved.");
