        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](37, "Each member of the board of directors and the staff of the corporation has a duty of loyalty to the corporation. The duty of loyalty generally requires a director or staff member to prefer the interests of the corporation over the director\u2019s/staff\u2019s interest or the interests of others. In addition, directors and staff of the corporation shall avoid acts of self-dealing which may adversely affect the tax-exempt status of the corporation or cause there to arise any sanction or penalty by a governmental authority.");
